import React, { PureComponent } from "react";
import PropTypes from "prop-types";
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import { Grid, Button } from '@material-ui/core';
import Box from '@material-ui/core/Box';
import Icon from '@material-ui/core/Icon';
// import HomeIcon from '@material-ui/icons/Home';

const useStyles = makeStyles((theme) => ({
        root: {
          flexGrow: 1,
        },
        // paper: {
        //   padding: theme.spacing(2),
        //   textAlign: 'center',
        //   color: theme.palette.text.secondary,
        // },
        sectionTitle: {
            color: '#FFFFFF',
            fontSize: 20,
            marginLeft: 10,
            paddingTop:14,
        },
        sideNav:{
                position: 'absolute',
                height: '100%',
        },
        navButton:{
                height:50,
                fontSize:20,
                marginLeft: 10,
                marginRight: 10,
        },

      }));

export default function SideButton(){

        const classes = useStyles();
        return (
                <Grid
                        container
                        direction="column"
                        justifyContent="center"
                        alignItems="flex-start"
                        xs={2}
                        className={classes.sideNav}
                >
                        <link rel="stylesheet" href="https://fonts.googleapis.com/icon?family=Material+Icons" />
                        <Grid
                        container
                        direction="row"
                        justifyContent="flex-start"
                        alignItems="flex-start"
                        className={classes.navItem}>
                                <Button color="primary" className={classes.navButton}><Icon>home</Icon></Button>
                                <Typography className={classes.sectionTitle} variant="h3" component="h2">
                                        Home
                                </Typography>

                        </Grid>
                        
                        <Grid
                        container
                        direction="row"
                        justifyContent="flex-start"
                        alignItems="flex-start"
                        className={classes.navItem}>
                                <Button color="primary" className={classes.navButton}><Icon>photo</Icon></Button>
                                <Typography className={classes.sectionTitle} variant="h3" component="h2">
                                        Gallery
                                </Typography>
                        </Grid>
                        <Grid
                        container
                        direction="row"
                        justifyContent="flex-start"
                        alignItems="flex-start"
                        className={classes.navItem}>
                                <Button color="primary" className={classes.navButton}><Icon>photo</Icon></Button>
                                <Typography className={classes.sectionTitle} variant="h3" component="h2">
                                        Recent
                                </Typography>
                        </Grid>
                </Grid>
                
        );
}
